import React from "react";
import "./Footer.css";
import Container from "react-bootstrap/Container";
import Navbar from "react-bootstrap/Navbar";

const Footer = () => {
  return (
    <Navbar bg="dark" fixed="bottom">
      <p id="p-copy">&copy; Daniel Nogueira</p>
    </Navbar>
  );
};

export default Footer;
